import React, { Component } from 'react';
import './Navbar.scss';
import $ from 'jquery';
import { Link } from 'react-router-dom';


export default class Navbar extends Component {
  componentDidMount() {
    $('.hamBox').on('click', function() {
      var open = true;
      $('.menu').slideToggle();
      // if(open) {
      //   $('.bagIcon').removeClass('slideOut');
      // } else {
      //   $('.bagIcon').addClass('slideOut');
      // }
      $('.bagIcon').toggleClass('slideOut');
    });
  }
  render() {
    return (
      <div>
        <nav>
          <span className="hamBox">
            <span className="ham" />
          </span>
          {/*   <span class="logoBox">ad</span> */}
          <span className="logoBox">

          </span>
          <span className="bag">
            <svg className="bagIcon" xmlns="http://www.w3.org/2000/svg" width={19} height={48} viewBox="0 0 19 48"><path fill="#FAFAFA" d="M16.5 16h-2.5c0-2.99-1.809-5-4.5-5s-4.5 2.01-4.5 5h-2.5c-.827 0-1.5.673-1.5 1.5v14c0 .827.673 1.5 1.5 1.5h14c.827 0 1.5-.673 1.5-1.5v-14c0-.827-.673-1.5-1.5-1.5zm-7-4c2.5 0 3.5 1.983 3.5 4h-7c0-2.017 1-4 3.5-4zm7.5 19.5c0 .276-.224.5-.5.5h-14c-.276 0-.5-.224-.5-.5v-14c0-.276.224-.5.5-.5h14c.276 0 .5.224.5.5v14z" /></svg>
          </span>
        </nav>
        <div className="menuCase">
          <ul className="menu">
            <li>Mac</li>
            <li>iPad</li>
            <li>iPhone</li>
            <li>Watch</li>
            <li>TV</li>
            <li>Music</li>
            <li>Support</li>
            <li>Search apple.com</li>
          </ul>
        </div>
      </div>
    )
  }
}
